from CSRandom import CSRandom
from ObjectInfo import ObjectInfo
from Utility import dayToYSD

class Location():
    def __init__(self, name):
         self.name = "";
         self.items = {};
         self.spawnable = {};
         self.front = {};
         self.alwaysFront = {};
         self.behindbush = {};
         self.behindtree = {};
         self.buildings = {};
         self.terrainFeatures = {};
         self.spawns = {}
         self.width = 0;
         self.height = 0;
         self.fspawnables = {};

    def calculateSpawns(self,seed,daysplayed):
        itemsLength = len(self.items)
        if itemsLength >= 6:
            return
        season = (daysplayed-1) // 28 % 4
        rand = CSRandom(int(seed // 2) +daysplayed)
        num1 = rand.Next(1, min(5, 7 - itemsLength))
        for index1 in range(num1):
            for index2 in range(11):
                x = rand.Next(self.width)
                y = rand.Next(self.height)
                tile = (x,y)
                index3 = rand.Next(len(self.spawns[season]))
                if self.items.get(tile) == None:
                   if tile in self.spawnable and tile not in self.fspawnables:
                      result = rand.Sample()
                      comparison = self.spawns[season][index3][1]
                      if result < comparison:
                            if tile not in self.buildings:
                               if tile not in self.front and tile not in self.alwaysFront:
                                  if tile not in self.terrainFeatures:
                                     if tile not in self.behindbush:
                                        #if Code uses Game1.random here.  Can't guarantee what state this is going to be in... (game1 rand.Sample() < 0.1 or tile not in location.behindtree):
                                        if tile not in self.behindtree:
                                            objectIndex = self.spawns[season][index3][0]
                                            self.items[tile] = ObjectInfo[objectIndex].split('/')[0]
                                            break;

    def processDay(self,seed,daysplayed):
        self.items.clear();

        dayOfMonth = ((daysplayed-1) % 28) + 1;
        day = dayOfMonth % 7;
        for dayOfWeek in range(day+1):
            localDaysPlayed = daysplayed - (day-dayOfWeek)
            dayOfMonth = ((localDaysPlayed-1) % 28) + 1
            if dayOfWeek == 0:
                if dayOfMonth == 28:
                    continue;
                self.calculateSpawns(seed,localDaysPlayed);
                self.calculateSpawns(seed,localDaysPlayed);

    
            self.calculateSpawns(seed,localDaysPlayed);
            if dayOfMonth == 1:
                self.calculateSpawns(seed,localDaysPlayed);
            if localDaysPlayed < 4:
                self.calculateSpawns(seed,localDaysPlayed);

